// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

contract LandSaleNotice {
    enum State {
        YAYINDA,
        ALICI_ICIN_KILITLENDI,
        YAYIN_DISI
    }

    event ilanYayindanKaldir(address addr, string gmId);

    State public state;
    string public gayrimenkulId;
    uint256 public rayicBedeli;
    uint256 public fiyat;
    bool public borcuVarMi;

    modifier inState(State expectedState) {
        require(
            state == expectedState,
            "Operaton is not allowed for this land"
        );
        _;
    }

    constructor(
        string memory gmId,
        uint256 rayicPrice,
        uint256 ilanFiyat,
        bool borcDurum
    ) {
        require(!borcDurum, "It is not allowed.");
        require(ilanFiyat >= rayicPrice, "It is not allowed.");
        state = State.YAYINDA;
        gayrimenkulId = gmId;
        fiyat = ilanFiyat;
        rayicBedeli = rayicPrice;
        borcuVarMi = borcDurum;
    }

    function yayindanKaldir() public inState(State.YAYINDA) {
        //require(afterDeadline(), "Deadline has not passed");

        if (state != State.ALICI_ICIN_KILITLENDI) {
            state = State.YAYIN_DISI;
        }
        emit ilanYayindanKaldir(address(this), gayrimenkulId);
    }
}
